const initialState = {
    date_start: '',
    date_end: '',
    balance_start: '',
    balance_end: '',
}

export default function dispatch(state = initialState, action) {
    switch (action.type) {
        case 'set_date_start': return { ...state, date_start: action.payload }
        case 'set_date_end': return { ...state, date_end: action.payload }
        case 'set_balance_start': return { ...state, balance_start: action.payload }
        case 'set_balance_end': return { ...state, balance_end: action.payload }

        default: return state
    }
}
